import React from 'react';

import {Tooltip,OverlayTrigger,Form,ButtonGroup,ButtonToolbar,CardColumns,CardGroup,Card,Button,Container,Nav,Navbar,NavDropdown } from 'react-bootstrap';

import 'bootstrap/dist/css/bootstrap.min.css';
import './SliderGame.css';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";





class Results extends React.Component{
  constructor(){
    super();
    this.state = {
      messages: [
        '3UP',
        '5UP',
        '2UP',
        'No Prize'
      ]
    }
  }

  render(){
    var shown = this.props.shown ? 'shown' : '';
    var classList = 'results ' + shown;
    return(
      <div className={classList}>
        {this.state.messages[this.props.prize]}
      </div>
    )
  };
};
export default Results;
